import { SxProps, Theme, Typography, Box } from "@mui/material";
import { useNavigate } from "react-router-dom";

function AddShops() {

  const wholeConShops : SxProps<Theme> = {
    minHeight: '100vh',
  }

  const headerShops : SxProps<Theme> = {
      display: 'flex',
      justifyContent: 'center',
      fontFamily: 'Times New Roman, Times, serif',
      fontSize : 'x-large',
  }

  const bodyShops : SxProps<Theme> = {
      'display': 'flex',
      'flex-direction': 'row',
      'align-items': 'center',
  }

  const body1 : SxProps<Theme> = {
      'display': 'flex',
      'flex': '1',
  }

  const body2 : SxProps<Theme> = {
      'display': 'flex',
      'flex': '1',
  }

  const buttonShops : SxProps<Theme> = {
      'display': 'flex',
      'justify-content': 'center',
      'align-items': 'center',
      'width': '100px',
      'height': '30px',
      'margin': '0 auto', 
      'margin-top': '1%',
      'background-color': 'burlywood',
  }



  return (
    <Box sx = {wholeConShops}>
        <Box sx={headerShops}>
            <h2>HERE YOU CAN ADD THE SHOPS</h2>
        </Box>
        <Box sx={bodyShops}>
            <Box sx={body1}><label>ENTER THE SHOP NAME      : </label></Box>
            <Box sx={body2}><input type='text'></input></Box><br/><br/>       
        </Box>
        <Box sx = {bodyShops}>
            <Box sx={body1}><label>ENTER THE SHOPLOCATION : </label></Box>
            <Box sx={body2}><input type='text'></input></Box><br/><br/>     
        </Box>
        <Box sx={buttonShops}><button>ADD SHOP</button></Box>
    </Box>
  )
}
export default AddShops
